package mypack;

public class SwapProgram {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int t =10;
		int s =20;
		int c;
		c = t;
		t = s;
		s = c;
		
		System.out.println("Print T Value:" +t);
		System.out.println("Print S Value:" +s);
		
		
		
				

	}

}
